program exercise2;
Var x, y, z, a, b : Real;
Begin
    Readln(x);
    Readln(y);
    Readln(z);
    
    a := (1 + sqr(sin(x + y))) / (2 + abs(x - (2 * x) / (1 + x*x*y*y))) + x;
    
    b := sqr(cos(arctan(1 / z)));
    
    Writeln(a:10:3);
    Writeln(b:10:3);
End.
