{
Задание 3
Даны x, y, z . Вычислить a, b, если:
a = (1 + sin^2(x+y))/(2 + abs(x - (2x)/(1 + x^2y^2)) + x
b = cos^2(arctg(1/z))
}
program exercise3;
Var a, b, c, p, S : Real;
Begin
    Readln(a);
    Readln(b);
    Readln(c);
    
    p := (a + b + c) / 2;
    
    S := sqrt(p * (p - a)*(p - b)*(p - c));
    
    Writeln(S:10:3);
End.
